import React, { useState, useEffect } from 'react';
import QrScanner from 'react-qr-scanner';
import axios from 'axios';
import './HomePage.css';

function HomePage() {
  const [result, setResult] = useState('');
  const [showScanner, setShowScanner] = useState(false);
  const [showGoods, setShowGoods] = useState(false);
  const [goodsList, setGoodsList] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  const handleScan = (data) => {
    if (data) {
      setResult(data.text);
      setShowScanner(false);

      // Ask to import or export
      const action = window.confirm('Do you want to import or export? Press OK for import, Cancel for export.');
      if (action) {
        handleImport(data.text);
      } else {
        handleExport(data.text);
      }
    }
  };

  const handleError = (err) => {
    console.error(err);
  };

  const handleImport = async (item) => {
    try {
      const parsedItem = JSON.parse(item);
      const response = await axios.post('/api/import', parsedItem);
      if (response.status === 201) {
        // Handle successful import
        console.log('Item imported successfully');
        // Optionally, update the goodsList in the frontend if needed
      } else {
        console.error('Error importing item:', response.data.message);
      }
    } catch (error) {
      console.error('Error importing item:', error);
    }
  };

  const handleExport = async (item) => {
    try {
      const parsedItem = JSON.parse(item);
      const response = await axios.post('/api/export', parsedItem);
      if (response.status === 200) {
        // Handle successful export
        console.log('Item exported successfully');
        // Optionally, update the goodsList in the frontend if needed
      } else {
        console.error('Error exporting item:', response.data.message);
      }
    } catch (error) {
      console.error('Error exporting item:', error);
    }
  };

  const handleViewGoods = () => {
    setShowGoods(true);
    setResult(''); // Clear the result when viewing goods
  };

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value || ''); // Ensure searchTerm is always a string
  };

  // Fetch goods data from the server
  useEffect(() => {
    const fetchGoods = async () => {
      try {
        const response = await axios.get('/api/goods');
        setGoodsList(response.data);
      } catch (error) {
        console.error('Error fetching goods:', error);
      }
    };

    if (showGoods) { // Fetch data only when viewing goods
      fetchGoods();
    }
  }, [showGoods]);

  // Filter goods based on search term
  const filteredGoods = goodsList.filter(good =>
    good.name && good.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div>
      <h2>Warehouse Management</h2>
      <button onClick={() => setShowScanner(true)}>Scan Goods</button>
      <button onClick={handleViewGoods}>View Goods</button>

      {showScanner && !showGoods && (
        <div className="qr-scanner-container">
          <QrScanner
            delay={300}
            onError={handleError}
            onScan={handleScan}
            className="qr-scanner"
          />
        </div>
      )}

      {showGoods && (
        <div className="goods-list">
          <h3>Available Goods</h3>
          <input
            type="text"
            placeholder="Search goods..."
            value={searchTerm}
            onChange={handleSearchChange}
            className="search-input"
          />
          <table>
            <thead>
              <tr>
                <th>Item Name</th>
                <th>Weight</th>
                <th>Expiry Date</th>
                <th>Stock Amount</th>
                <th>Date Created</th>
              </tr>
            </thead>
            <tbody>
              {filteredGoods.map((good, index) => (
                <tr key={index}>
                  <td>{good.name}</td>
                  <td>{good.weight}</td>
                  <td>{good.expiryDate}</td>
                  <td>{good.stockAmount}</td>
                  <td>{good.createdAt}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {!showGoods && result && (
        <p>Scanned Result: {result}</p>
      )}
    </div>
  );
}

export default HomePage;
